import React, { Component } from 'react';
import {
    Platform,
    StyleSheet,
    Text,
    View,
    StatusBar
} from 'react-native';
export default class Login extends Component<{}> {
    render() {
        <View>
            <Text>Login</Text>
        </View>
    }
}
